import React from "react";
import { Routes, Route } from "react-router-dom";
import "./App.css";
import Main from "./pages/Auth/main";
import Registration from "./pages/Auth/registration";

function App() {
  return (
    <>
      <Routes>
        <Route
          exact
          path="/registration"
          element={(_props) => <Registration />}
        />
        <Route exact path="/" element={(props) => <Main />} />
      </Routes>
    </>
  );
}

export default App;
